<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Image Mosaic</title>
  <style>
    :root {
      /* Change this to control how big each square “cell” is */
      --cell-size: 180px;
      /* Gap between images */
      --gap-size: 4px;
    }
    body {
      margin: 0;
      background: #111;         /* dark background to make photos pop */
    }
    .gallery {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(var(--cell-size), 1fr));
      grid-auto-rows: var(--cell-size);
      gap: var(--gap-size);
      padding: var(--gap-size);
    }
    .gallery img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      display: block;
    }
  </style>
</head>
